import React, { Component } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import  {Navbar,Container, Nav} from "react-bootstrap";
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
  } from "react-router-dom";

export default class NavbarComp extends Component {
  render() {
    return (
    <Router>
    <div>
        <Navbar expand="lg" className="bg-body-tertiary">
        <Container>
            <Navbar.Brand href="#home">Boston_GG_Events</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
                <Nav.Link as = {Link} to = {"/home"}> Home</Nav.Link>
                <Nav.Link as = {Link} to = {"/home"}>Events</Nav.Link>
                <Nav.Link as = {Link} to = {"/home"}>Balloon</Nav.Link>
                <Nav.Link href="#link">Flower</Nav.Link>
                <Nav.Link href="#link">Grab and Go</Nav.Link>
            </Nav>
            </Navbar.Collapse>
        </Container>

        </Navbar>
    </div>
    </Router>
)
  }
}
